const videos = [
    {
        name: 'Video1',
        duration: 15,
        id:1,

    },
    {
        name: 'ПорноПриколы',
        duration: 15,
        id:2,

    },
    {
        name: 'Роблокс',
        duration: 15,
        id:3,

    }
]
export function VideoList(){
    return (
        <>
        {
            videos.map((video)=>{
                return(
                    <div key={video.id}>
                        <p class="name">{video.name}</p>
                        <p>{video.duration}</p>
                        <button>Просмотреть</button>
                    </div>
                )
            })
        }
        </>
    )
}
